import { useQuery } from 'react-query'

import { VictoryChart, VictoryLine, VictoryTheme } from 'victory'

const Test = () => {
  return (
    <VictoryChart theme={VictoryTheme.material}>
      <VictoryLine
        style={{
          data: { stroke: '#c43a31' },
          parent: { border: '1px solid #ccc' },
        }}
        data={[
          { x: 1, y: 2 },
          { x: 2, y: 3 },
          { x: 3, y: 5 },
          { x: 4, y: 4 },
          { x: 5, y: 7 },
        ]}
        categories={{ x: ['하나', '둘', '셋', '넷', '다섯'], y: ['하나', '둘', '셋', '넷', '다섯'] }}
      />
    </VictoryChart>
  )
}

export default Test
